import React from "react";
import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footerr from "components/Footers/Footerr";

function NewTicketForm() {
  return (
    <div style={containerStyle}>
      <header style={headerStyle}>
        <IndexNavbar />
      </header>

      <main style={mainStyle}>
        <div style={cardStyle}>
          <div style={headerSection}>
            <div>
              <h1 style={titleStyle}>Nouveau Ticket STB</h1>
              <p style={subtitleStyle}>Support technique de la Banque STB</p>
            </div>
            <button style={returnButtonStyle}>‚Üê Retour √† la liste</button>
          </div>

          <form style={formStyle}>
            {/* Les champs du formulaire restent identiques */}
            <div style={inputGroup}>
              <label style={labelStyle}>üìù Sujet du ticket</label>
              <input
                type="text"
                placeholder="Ex: Mon acc√®s Internet est bloqu√©"
                style={inputStyle}
              />
            </div>

            <div style={inputGroup}>
              <label style={labelStyle}>üè¢ D√©partement concern√©</label>
              <select style={selectStyle}>
                <option>IT - Informatique</option>
                <option>RH - Ressources Humaines</option>
                <option>Comptabilit√©</option>
              </select>
            </div>

            <div style={inputGroup}>
              <label style={labelStyle}>üìÑ Description d√©taill√©e</label>
              <textarea
                rows="5"
                placeholder="D√©crivez votre probl√®me ici..."
                style={textareaStyle}
              />
            </div>

            <button type="submit" style={submitButtonStyle}>
              üì® Envoyer le ticket
            </button>
          </form>
        </div>
      </main>

      <Footerr />
    </div>
  );
}

// Nouveaux styles avec arri√®re-plan int√©gr√©
const containerStyle = {
  minHeight: '100vh',
  display: 'flex',
  flexDirection: 'column',
  background: `
    linear-gradient(
      160deg,
      rgba(245, 248, 250, 0.98) 0%,
      rgba(240, 245, 250, 0.98) 100%
    ),
    url('https://www.stb.com.tn/images/background-pattern.png')
  `,
  backgroundSize: 'cover',
  backgroundAttachment: 'fixed',
  position: 'relative',
};

const headerStyle = {
  position: 'sticky',
  top: 0,
  zIndex: 1000,
  boxShadow: '0 2px 10px rgba(0,0,0,0.08)',
  background: 'rgba(255, 255, 255, 0.95)',
  backdropFilter: 'blur(6px)',
};

const mainStyle = {
  flex: 1,
  padding: '100px 20px 120px', // Augmentation du padding bas pour le footer
  maxWidth: '800px',
  margin: '0 auto',
  width: '100%',
};

const cardStyle = {
  backgroundColor: 'rgba(255, 255, 255, 0.97)',
  borderRadius: '18px',
  padding: '2.5rem',
  boxShadow: '0 8px 30px rgba(0,0,0,0.12)',
  border: '1px solid rgba(240, 242, 245, 0.8)',
  backdropFilter: 'blur(4px)',
};

// ... (les autres styles restent identiques √† la version pr√©c√©dente) ...

const submitButtonStyle = {
  // ... styles existants ...
  boxShadow: '0 4px 15px rgba(13, 71, 161, 0.15)',
};

export default NewTicketForm;
